member.summary:
Use to generate customized CodeText for Code128 barcode.

[C#]
Code128CodeBuilder builder = new Code128CodeBuilder(Code128CodeSet.A);
string codeText = builder.Append("1234").Switch(Code128CodeSet.B).Append("5678").ToString();
BarCodeBuilder b = new BarCodeBuilder(codeText,Symbology.Code128);
b.Save("test.png");

